#[cfg(table_gen)]
mod table_gen {
    use super::*;

    pub fn decipher_char(cipher: u8, key: u8) -> u8 {
        let kc: u8;
        let first = if cipher.is_ascii_uppercase() {
            kc = key.to_ascii_uppercase();
            b'A'
        } else {
            kc = key.to_ascii_lowercase();
            b'a'
        };

        let mut rem = (cipher - first) as i8 - (kc - first) as i8;
        if rem < 0 { rem += ALPHABET_SIZE as i8; }

        (first + rem as u8)
    }

    pub fn create_lookup_table() -> Table {
        let mut table = [[0; 256]; 256];
        for cipher in 0..=255u8 {
            for key in 0..=255u8 {
                table[cipher as usize][key as usize] = decipher_char(cipher, key);
            }
        }
        table
    }
}
